// nightland/src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App'; // Should import the default export

console.log('index.js: Starting React app');
const root = ReactDOM.createRoot(document.getElementById('root'));
console.log('index.js: Root created, rendering App');
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
console.log('index.js: Render completed');
